import React, { useState } from 'react'
import { testConnection } from '../lib/supabaseClient'
import { insertItem, fetchAllItems, updateItem, deleteItem, getItemById } from '../lib/supabaseCRUD'
import { uploadFile, getPublicUrl, listFiles, deleteFile } from '../lib/supabaseStorage'

const SupabaseTestComponent: React.FC = () => {
  const [results, setResults] = useState<string[]>([])
  const [loading, setLoading] = useState(false)
  const [file, setFile] = useState<File | null>(null)

  const addResult = (message: string, isError = false) => {
    setResults(prev => [...prev, `${isError ? 'âŒ' : 'âœ…'} ${message}`])
  }

  const clearResults = () => {
    setResults([])
  }

  // Test connection
  const testSupabaseConnection = async () => {
    setLoading(true)
    addResult('Testing Supabase connection...')
    
    const result = await testConnection()
    if (result.success) {
      addResult('Supabase connection successful!')
    } else {
      addResult(`Connection failed: ${JSON.stringify(result.error)}`, true)
    }
    
    setLoading(false)
  }

  // Test CRUD operations
  const testCRUDOperations = async () => {
    setLoading(true)
    clearResults()
    
    try {
      // 1. Insert item
      addResult('Testing INSERT operation...')
      const insertResult = await insertItem({ name: 'Test Item ' + Date.now() })
      if (!insertResult.success) {
        addResult(`Insert failed: ${JSON.stringify(insertResult.error)}`, true)
        return
      }
      const newItem = insertResult.data?.[0]
      addResult(`Item inserted with ID: ${newItem?.id}`)

      // 2. Fetch all items
      addResult('Testing FETCH ALL operation...')
      const fetchResult = await fetchAllItems()
      if (!fetchResult.success) {
        addResult(`Fetch failed: ${JSON.stringify(fetchResult.error)}`, true)
        return
      }
      addResult(`Fetched ${fetchResult.data?.length || 0} items`)

      // 3. Update item
      if (newItem?.id) {
        addResult('Testing UPDATE operation...')
        const updateResult = await updateItem(newItem.id, { name: 'Updated Item ' + Date.now() })
        if (!updateResult.success) {
          addResult(`Update failed: ${JSON.stringify(updateResult.error)}`, true)
        } else {
          addResult('Item updated successfully')
        }

        // 4. Get single item
        addResult('Testing GET BY ID operation...')
        const getResult = await getItemById(newItem.id)
        if (!getResult.success) {
          addResult(`Get item failed: ${JSON.stringify(getResult.error)}`, true)
        } else {
          addResult(`Retrieved item: ${getResult.data?.name}`)
        }

        // 5. Delete item
        addResult('Testing DELETE operation...')
        const deleteResult = await deleteItem(newItem.id)
        if (!deleteResult.success) {
          addResult(`Delete failed: ${JSON.stringify(deleteResult.error)}`, true)
        } else {
          addResult('Item deleted successfully')
        }
      }

    } catch (error) {
      addResult(`CRUD test error: ${error}`, true)
    }
    
    setLoading(false)
  }

  // Test file upload
  const testFileUpload = async () => {
    if (!file) {
      addResult('Please select a file first', true)
      return
    }

    setLoading(true)
    addResult('Testing FILE UPLOAD...')
    
    try {
      // Upload file
      const uploadResult = await uploadFile(file, 'files')
      if (!uploadResult.success) {
        addResult(`Upload failed: ${JSON.stringify(uploadResult.error)}`, true)
        return
      }
      
      const fileName = uploadResult.data?.path
      addResult(`File uploaded: ${fileName}`)

      // Get public URL
      const urlResult = getPublicUrl('files', fileName!)
      if (!urlResult.success) {
        addResult(`Get URL failed: ${JSON.stringify(urlResult.error)}`, true)
      } else {
        addResult(`Public URL: ${urlResult.data}`)
      }

      // List files
      const listResult = await listFiles('files')
      if (listResult.success) {
        addResult(`Files in bucket: ${listResult.data?.length || 0}`)
      }

    } catch (error) {
      addResult(`File upload error: ${error}`, true)
    }
    
    setLoading(false)
  }

  return (
    <div style={{ 
      padding: '20px', 
      margin: '20px', 
      border: '1px solid #ccc', 
      borderRadius: '8px',
      backgroundColor: '#f9f9f9'
    }}>
      <h2>ðŸ§ª Supabase Test Component</h2>
      
      <div style={{ marginBottom: '20px' }}>
        <button 
          onClick={testSupabaseConnection} 
          disabled={loading}
          style={{ margin: '5px', padding: '10px 15px' }}
        >
          Test Connection
        </button>
        
        <button 
          onClick={testCRUDOperations} 
          disabled={loading}
          style={{ margin: '5px', padding: '10px 15px' }}
        >
          Test CRUD Operations
        </button>
        
        <button 
          onClick={clearResults}
          style={{ margin: '5px', padding: '10px 15px' }}
        >
          Clear Results
        </button>
      </div>

      <div style={{ marginBottom: '20px' }}>
        <h3>File Upload Test:</h3>
        <input 
          type="file" 
          onChange={(e) => setFile(e.target.files?.[0] || null)}
          style={{ margin: '5px' }}
        />
        <button 
          onClick={testFileUpload} 
          disabled={loading || !file}
          style={{ margin: '5px', padding: '10px 15px' }}
        >
          Upload File
        </button>
      </div>

      <div style={{ 
        backgroundColor: '#f0f0f0', 
        padding: '15px', 
        borderRadius: '5px',
        maxHeight: '400px',
        overflowY: 'auto'
      }}>
        <h3>Test Results:</h3>
        {results.length === 0 ? (
          <p>Click a test button to see results...</p>
        ) : (
          results.map((result, index) => (
            <div key={index} style={{ margin: '5px 0', fontFamily: 'monospace' }}>
              {result}
            </div>
          ))
        )}
      </div>
    </div>
  )
}

export default SupabaseTestComponent
